const apiKey = '6Qs6dFXbJsut9GY7e39vHkb6I33XNCV1';

const httpCall = fetch(`https://api.giphy.com/v1/gifs/random?api_key=${ apiKey }`);

httpCall.then( resp => {
    // console.log(resp)
    resp.json().then( data => {
        console.log(data.imagenes.orig);
    })
})
.catch( console.warn);
